import { ReactComponent as TeamsImg } from "../../shared/icons/group_person_rounded.svg";
import { ReactComponent as PlayersImg } from "../../shared/icons/person_rounded.svg";
import { IMenu } from "../../interfaces/interfaces";
import { SidebarLink } from "./sidebarLink/sidebarLink";
export const MENU: IMenu[] = [
  {
    id: 1,
    name: "Teams",
    img: TeamsImg,
    to: "/teams",
  },
  {
    id: 2,
    name: "Players",
    img: PlayersImg,
    to: "/players",
  },
];

export const menuList = MENU.map(({ id, to, img, name }) => {
  return <SidebarLink key={id} id={id} to={to} img={img} name={name} />;
});
